import Plot from 'react-plotly.js';

class PieChart1 extends Component {
    render() {
        return (
            <div>
                <Plot
                    data={[
                        {type: 'pie',
                            labels: PC2countries,
                            values: PC2count}
                        ]}
                    layout={ { width: 1000, height: 500, title: 'Most Technology Schools', paper_bgcolor:'#E4DCCF'}}
                />
            </div>
        )
    }
}
export default PieChart1;
